function Login(){

        return (
            <fieldset id="login_form">
                <h2>로그인/회원가입</h2>
                <fieldset id="login">
                    <div id="id">
                        <label for="user-id">아이디(6자 이상)</label>
                        <input type="text" id="user-id" required placeholder="ID 입력"/>
                    </div>
                    <div id="password">
                        <label for="user-pwd">비밀번호</label>
                        <input type="password" id="user-pwd" required/>
                    </div>
                </fieldset>
            </fieldset>
        );

}

export default Login;
